import { View, Text, StyleSheet, ImageBackground, Image, TextInput } from 'react-native'
import React from 'react'
import loginBgImage from "../images/loginBg.jpg";
import loginIcon from "../images/loginIcon.png";
import logoImage from "../images/bdrentz.png";
import backgroundImage from "../images/background.jpg";
import Button from '../components/button/Button';

export default function Otp() {
    const handleSubmit = ()=>{
        console.log("??");
    }
  return (
    <View style={styles.container}>
    <View style={styles.otpTopCotainer}>
       <ImageBackground source={otpBgImage} resizeMode="cover" style={{flex:1}}>
           <View style={styles.titleContainer}>
               <Text style={styles.loginTitle}>THE LARGEST</Text>
               <Text style={styles.loginTitle}>EQUIPMENT RENTAL NETWORK</Text>
           </View>
       </ImageBackground>
    </View>
    <View style={styles.otpBottomCotainer}>
           <View>
              <Image style={styles.loginIcon} source={loginIcon} />
           </View>
           <View>
             <Text>LOGIN AS CUSTOMAR</Text>
           </View>
           <View>
              <TextInput style={styles.otpInput} placeholder="Enter your mobile number" />
           </View>
           <View>
              <Button onPress={()=> handleSubmit()} style={styles.cusLogin} label="Next" bgColor="#f6921e" color="#fff" onPress={handleSubmit} />
           </View>
    </View>
</View>
  )
}


const styles = StyleSheet.create({
    container:{
        flex:1
    }
})
